import React from "react";
import '../Assets/Styles/MenuComponentStyles.css'
import MenuButtonComponent from "./MenuButtonComponent";

function MenuComponent(){
    return(
        <div className="menu-container">
            <MenuButtonComponent msj="Projects"></MenuButtonComponent>
            <MenuButtonComponent msj="More Info "></MenuButtonComponent>
            <MenuButtonComponent msj="Contact me"></MenuButtonComponent>
        </div>
    );
}

export default MenuComponent;
